import react, { Component } from 'react';
import '../App.css';

export default class Modal extends Component {
    render() {
        return (
            <div className="modal display-block">
                <section className="modal-main">
                    <button type="button" onClick={this.props.handleClose}>
                        Close
                </button>
                </section>
            </div >
        );
    }
};
